// import "./css/Main.css"


function Homepage() {
  return (
    <div className="Homepage">
      <h2>Welcome to this website</h2>
      <p><strong>Falling neatly on to the 77<sup>th</sup> Anniversary of the D-Day Landings, IWM Duxford’s
       second flying day of the year was a treat for all fans of the ‘heavy iron’ warbirds. As a showcase of flying,
        ‘Commemorating D-Day’ really did show off IWM Duxford’s flying displays at their very best on a very pleasant
         early summer afternoon. </strong></p>
         <p>With the world fighting for its own D-Day since the start of the COVID-19 pandemic, Duxford's second flying day aptly commemorated the start of Operation Overlord 77 years ago to the present day.</p>

    </div>



  );
}

export default Homepage;
